import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { jwtDecode } from 'jwt-decode';
import { useAuth } from '../components/AuthContext';
import '../Pages/LoginPage.css';

const LoginPage = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();
  const auth = useAuth();

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('https://localhost:5001/api/auth/login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({ email, password })
      });
      const data = await response.json();
      if (response.ok) {
        auth.login(data.token);
        const decoded = jwtDecode(data.token);
        navigate(`/home/${decoded.role.toLowerCase()}`);
      } else {
        alert('Login failed');
      }
    } catch (error) {
      console.error('Login error', error);
    }
  };

  return (
    <div className="login-page">
      <header>
        <nav className="navbar">
          <div className="navbar-left">
            <a href="/" className="logo">exploreX</a>
            <ul className="nav-links">
              <li><a href="#home">Home</a></li>
              <li><a href="#destination">Destination</a></li>
              <li><a href="#about">About Us</a></li>
            </ul>
          </div>
          <div className="navbar-right">
            <input type="text" placeholder="Search" />
            <button className="search-btn">Search</button>
          </div>
        </nav>
      </header>
      <main>
        <div className="login-container">
          <h1>Welcome Back!</h1>
          <form onSubmit={handleLogin}>
            <input
              type="email"
              placeholder="Email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            <input
              type="password"
              placeholder="Password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <a href="#forgot-password" className="forgot-password">Forgot Password?</a>
            <button type="submit" className="login-btn">Login</button>
          </form>
          <p className="signup-text">You Don't Have An Account? <a href="#signup">Join Us Now</a></p>
          <div className="social-login">
            <button className="social-btn google">Continue With Google</button>
            <button className="social-btn facebook">Continue With Facebook</button>
            <button className="social-btn apple">Continue With Apple</button>
          </div>
        </div>
      </main>
      <footer>
        <div className="footer-content">
          <div className="contact-info">
            <p>Contact</p>
            <p>123, Flower Garden, Valley</p>
            <p>+12-3456-7890</p>
            <p>exploreX@gmail.com</p>
          </div>
          <div className="quick-links">
            <p>Quick Links</p>
            <ul>
              <li><a href="#menu">Menu</a></li>
              <li><a href="#blog">Blog</a></li>
              <li><a href="#our-team">Our Team</a></li>
            </ul>
          </div>
        </div>
      </footer>
    </div>
  );
};

export default LoginPage;
